// @flow
import styled from "styled-components";

const EmptyStyled = styled.div`
  color: #ccc;
  font-size: 1.5rem;
  font-weight: bold;
  padding: 120px 30px
  text-align: center;
  width: 100%;
`;

export default EmptyStyled;
